			itemId = is.popInteger();
			pos = is.pop(Vector3.class);
			rotation = is.pop(Vector3F.class);
			targetID = is.popInteger();
			targetType = is.popInteger();
			ownerID = is.popInteger();
			timeTick = is.pop(TimeTick.class);
